import ProductCard from "./ProductCards"
import React, { useState } from 'react';
import { productListAction } from "../Redux/Actions/productAction";
import { useEffect } from "react";
import { useDispatch, useSelector } from "react-redux";
import { Pagination } from "@mui/material";
import PaginationTo from "./Pagination";
import axios from "axios";
const Category = () => {

    const productList = useSelector((state) => state.productList);
    const dispatch = useDispatch();
    const [allCategory, setAllCategory] = useState()
    const [allFlavour, setAllFlavour] = useState()
    const [allWeight, setAllWeight] = useState()

    useEffect(() => {
        var config = {
            method: 'get',
            url: 'http://localhost:8080/getAllCategory',
            headers: {}
        };

        axios(config)
            .then(function (response) {
                setAllCategory((response.data.message));
            })
            .catch(function (error) {
                console.log(error);
            });
        var config = {
            method: 'get',
            url: 'http://localhost:8080/getAllFlavour',
            headers: {}
        };

        axios(config)
            .then(function (response) {
                setAllFlavour((response.data.message));
            })
            .catch(function (error) {
                console.log(error);
            });
        var config = {
            method: 'get',
            url: 'http://localhost:8080/getAllWeight',
            headers: {}
        };

        axios(config)
            .then(function (response) {
                setAllWeight((response.data.message));
            })
            .catch(function (error) {
                console.log(error);
            });

        dispatch(productListAction(1, "ALL", "ALL", "ALL", "NEWEST"))
    }, [])
    const [category, setCategory] = useState("ALL");
    const [flavour, setFlavour] = useState("ALL");
    const [weight, setWeight] = useState("ALL");
    const [sort, setSort] = useState("NEWEST");

    const [open1, setOpen1] = useState(false);
    const [open2, setOpen2] = useState(false);
    const [open3, setOpen3] = useState(false);
    const [open4, setOpen4] = useState(false);
    const [open5, setOpen5] = useState(false);


    const categoryChange = (data) => {

        dispatch(productListAction(1, data, flavour, weight, sort));
    }

    const weightChange = (data) => {

        dispatch(productListAction(1, category, flavour, data, sort));
    }

    const flavourChange = (data) => {

        dispatch(productListAction(1, category, data, weight, sort));
    }

    const SortChange = (data) => {

        dispatch(productListAction(1, category, flavour, weight, data));
    }
    return (
        <>

            <div className="bg-white -mt-20 md:-mt-10">
                <div>
                    {open5 &&
                        <div className="relative z-40 lg:hidden" role="dialog" aria-modal="true">

                            <div className="fixed inset-0 bg-black bg-opacity-25"></div>

                            <div className="fixed inset-0 z-40 flex">

                                <div className="relative ml-auto flex h-full w-full max-w-xs flex-col overflow-y-auto bg-white py-4 pb-12 shadow-xl">
                                    <div className="flex items-center justify-between px-4">
                                        <h2 className="text-lg font-medium text-gray-900">Filters</h2>
                                        <button onClick={() => { setOpen5(!open5) }} type="button" className="-mr-2 flex h-10 w-10 items-center justify-center rounded-md bg-white p-2 text-gray-400">
                                            <span className="sr-only">Close menu</span>

                                            <svg className="h-6 w-6" xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" stroke-width="1.5" stroke="currentColor" aria-hidden="true">
                                                <path stroke-linecap="round" stroke-linejoin="round" d="M6 18L18 6M6 6l12 12" />
                                            </svg>
                                        </button>
                                    </div>


                                    <form className="mt-4 border-t border-gray-200">
                                        <h3 className="sr-only">Categories</h3>
                                        <ul role="list" className="px-2 py-3 font-medium text-gray-900">
                                            <li>
                                                <a href="#">PROTIEN</a>
                                            </li>

                                            <li>
                                                <a href="#">GAINER</a>
                                            </li>

                                            <li>
                                                <a href="#">BCAA</a>
                                            </li>

                                            <li>
                                                <a href="#">ISO RICH PROTIEN</a>
                                            </li>
                                        </ul>

                                        <div className="border-t border-gray-200 px-4 py-6">
                                            <h3 className="-mx-2 -my-3 flow-root">

                                                <button onClick={() => { setOpen1(!open1) }} type="button" className="flex w-full items-center justify-between bg-white px-2 py-3 text-gray-400 hover:text-gray-500" aria-controls="filter-section-mobile-0" aria-expanded="false">
                                                    <span className="font-medium text-gray-900">Color</span>
                                                    <span className="ml-6 flex items-center">
                                                        {!open1 &&
                                                            <svg className="h-5 w-5" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 20 20" fill="currentColor" aria-hidden="true">
                                                                <path d="M10.75 4.75a.75.75 0 00-1.5 0v4.5h-4.5a.75.75 0 000 1.5h4.5v4.5a.75.75 0 001.5 0v-4.5h4.5a.75.75 0 000-1.5h-4.5v-4.5z" />
                                                            </svg>
                                                        }
                                                        {open1 &&
                                                            <svg className="h-5 w-5" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 20 20" fill="currentColor" aria-hidden="true">
                                                                <path fill-rule="evenodd" d="M3 10a.75.75 0 01.75-.75h10.5a.75.75 0 010 1.5H3.75A.75.75 0 013 10z" clip-rule="evenodd" />
                                                            </svg>
                                                        }
                                                    </span>
                                                </button>
                                            </h3>
                                            <div className="pt-6" id="filter-section-mobile-0">
                                                {open1 &&
                                                    <div className="space-y-4">
                                                        <div className="flex items-center">
                                                            <input id="filter-category-0" onChange={() => { setFlavour("ALL"); flavourChange("ALL") }} checked={category === "ALL" ? true : false} name="category[]" value="new-arrivals" type="checkbox" className="h-4 w-4 rounded border-gray-300 text-indigo-600 focus:ring-indigo-500" />
                                                            <label htmlFor="filter-category-0" className="ml-3 text-sm text-gray-600">ALL</label>
                                                        </div>
                                                        {allFlavour?.map((data, index) => (
                                                            <>
                                                                <div className="flex items-center" key={index}>
                                                                    <input id="filter-color-0" onChange={() => { setFlavour(data.product_flavour); flavourChange(data.product_flavour) }} checked={flavour === data.product_flavour ? true : false} name="color[]" value="white" type="checkbox" className="h-4 w-4 rounded border-gray-300 text-indigo-600 focus:ring-indigo-500" />
                                                                    <label for="filter-color-0" className="ml-3 text-sm text-gray-600">{data.product_flavour}</label>
                                                                </div>
                                                            </>
                                                        ))}
                                                    </div>
                                                }
                                            </div>

                                        </div>

                                        <div className="border-t border-gray-200 px-4 py-6">
                                            <h3 className="-mx-2 -my-3 flow-root">

                                                <button onClick={() => { setOpen2(!open2) }} type="button" className="flex w-full items-center justify-between bg-white px-2 py-3 text-gray-400 hover:text-gray-500" aria-controls="filter-section-mobile-1" aria-expanded="false">
                                                    <span className="font-medium text-gray-900">Category</span>
                                                    <span className="ml-6 flex items-center">

                                                        {!open2 &&
                                                            <svg className="h-5 w-5" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 20 20" fill="currentColor" aria-hidden="true">
                                                                <path d="M10.75 4.75a.75.75 0 00-1.5 0v4.5h-4.5a.75.75 0 000 1.5h4.5v4.5a.75.75 0 001.5 0v-4.5h4.5a.75.75 0 000-1.5h-4.5v-4.5z" />
                                                            </svg>
                                                        }
                                                        {open2 &&
                                                            <svg className="h-5 w-5" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 20 20" fill="currentColor" aria-hidden="true">
                                                                <path fill-rule="evenodd" d="M3 10a.75.75 0 01.75-.75h10.5a.75.75 0 010 1.5H3.75A.75.75 0 013 10z" clip-rule="evenodd" />
                                                            </svg>
                                                        }
                                                    </span>
                                                </button>
                                            </h3>
                                            {open2 &&
                                                <div className="pt-6" id="filter-section-mobile-1">
                                                    <div className="space-y-6">
                                                        <div className="flex items-center">
                                                            <input id="filter-category-0" onChange={() => { setCategory("ALL"); categoryChange("ALL") }} checked={category === "ALL" ? true : false} name="category[]" value="new-arrivals" type="checkbox" className="h-4 w-4 rounded border-gray-300 text-indigo-600 focus:ring-indigo-500" />
                                                            <label htmlFor="filter-category-0" className="ml-3 text-sm text-gray-600">ALL</label>
                                                        </div>
                                                        {allCategory?.map((data, index) => (
                                                            <>
                                                                <div className="flex items-center" key={index}>
                                                                    <input id="filter-category-0" onChange={() => { setCategory(data.product_category); categoryChange(data.product_category) }} checked={category === data.product_category ? true : false} name="category[]" value="new-arrivals" type="checkbox" className="h-4 w-4 rounded border-gray-300 text-indigo-600 focus:ring-indigo-500" />
                                                                    <label htmlFor="filter-category-0" className="ml-3 text-sm text-gray-600">{data.product_category}</label>
                                                                </div>
                                                            </>
                                                        ))}

                                                    </div>
                                                </div>
                                            }
                                        </div>

                                        <div className="border-t border-gray-200 px-4 py-6">
                                            <h3 className="-mx-2 -my-3 flow-root">

                                                <button onClick={() => { setOpen3(!open3) }} type="button" className="flex w-full items-center justify-between bg-white px-2 py-3 text-gray-400 hover:text-gray-500" aria-controls="filter-section-mobile-2" aria-expanded="false">
                                                    <span className="font-medium text-gray-900">Weight</span>
                                                    <span className="ml-6 flex items-center">
                                                        {!open3 &&
                                                            <svg className="h-5 w-5" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 20 20" fill="currentColor" aria-hidden="true">
                                                                <path d="M10.75 4.75a.75.75 0 00-1.5 0v4.5h-4.5a.75.75 0 000 1.5h4.5v4.5a.75.75 0 001.5 0v-4.5h4.5a.75.75 0 000-1.5h-4.5v-4.5z" />
                                                            </svg>
                                                        }
                                                        {open3 &&
                                                            <svg className="h-5 w-5" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 20 20" fill="currentColor" aria-hidden="true">
                                                                <path fill-rule="evenodd" d="M3 10a.75.75 0 01.75-.75h10.5a.75.75 0 010 1.5H3.75A.75.75 0 013 10z" clip-rule="evenodd" />
                                                            </svg>
                                                        }
                                                    </span>
                                                </button>
                                            </h3>
                                            {open3 &&
                                                <div className="pt-6" id="filter-section-mobile-2">
                                                    <div className="space-y-4">
                                                        <div className="flex items-center">
                                                            <input id="filter-size-0" name="size[]" onChange={() => { setWeight("ALL"); weightChange("ALL") }} checked={weight === "ALL" ? true : false} value="2l" type="checkbox" className="h-4 w-4 rounded border-gray-300 text-indigo-600 focus:ring-indigo-500" />
                                                            <label for="filter-size-0" className="ml-3 text-sm text-gray-600">ALL</label>
                                                        </div>
                                                        {allWeight?.map((data, index) => (
                                                            <>
                                                                <div className="flex items-center" key={index}>
                                                                    <input id="filter-size-0" name="size[]" onChange={() => { setWeight(data.product_weight); weightChange(data.product_weight) }} checked={weight === data.product_weight ? true : false} value="2l" type="checkbox" className="h-4 w-4 rounded border-gray-300 text-indigo-600 focus:ring-indigo-500" />
                                                                    <label for="filter-size-0" className="ml-3 text-sm text-gray-600">{data.product_weight}</label>
                                                                </div>
                                                            </>
                                                        ))}
                                                    </div>
                                                </div>
                                            }
                                        </div>
                                    </form>
                                </div>
                            </div>
                        </div>
                    }
                    <main className="mx-auto max-w-7xl px-4 sm:px-6 lg:px-8">
                        <div className="flex items-baseline justify-between border-b border-gray-200 pt-24 pb-6">
                            <h1 className="text-4xl font-bold tracking-tight text-gray-900">New Arrivals</h1>

                            <div className="flex items-center">
                                <div className="relative inline-block text-left">
                                    <div>
                                        <button onClick={() => { setOpen1(!open1) }} on type="button" className="group inline-flex justify-center text-sm font-medium text-gray-700 hover:text-gray-900" id="menu-button" aria-expanded="false" aria-haspopup="true">
                                            Sort
                                            <svg className="-mr-1 ml-1 h-5 w-5 flex-shrink-0 text-gray-400 group-hover:text-gray-500" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 20 20" fill="currentColor" aria-hidden="true">
                                                <path fill-rule="evenodd" d="M5.23 7.21a.75.75 0 011.06.02L10 11.168l3.71-3.938a.75.75 0 111.08 1.04l-4.25 4.5a.75.75 0 01-1.08 0l-4.25-4.5a.75.75 0 01.02-1.06z" clip-rule="evenodd" />
                                            </svg>
                                        </button>
                                    </div>
                                    {open1 &&
                                        <div className="absolute right-0 z-10 mt-2 w-40 origin-top-right rounded-md bg-white shadow-2xl ring-1 ring-black ring-opacity-5 focus:outline-none" role="menu" aria-orientation="vertical" aria-labelledby="menu-button" tabindex="-1">
                                            <div className="py-1" role="none">
